interface Group {
  id: string;
  full_name: string;
  abbreviation: string;
  users?: object;
  create_at?: string;
  updated_at?: string;
}

const runtimeConfig = useRuntimeConfig();

export const formatGroupDates = (groups: Group[]): Group[] => {
  groups.forEach(group => {
    group.create_at = formatDate(group.create_at);
    group.updated_at = formatDate(group.updated_at);
  });
  return groups;
};

const formatDate = (dateString: string): string => {
  const options = {
    year: 'numeric',
    month: '2-digit',
    day: '2-digit',
    hour: '2-digit',
    minute: '2-digit',
    second: '2-digit'
  };
  const date = new Date(dateString);
  // @ts-ignore
  return date.toLocaleString('ru-RU', options);
};

export const getGroupFullNames = (groups: Group[]) => {
  return groups.map(group => group.abbreviation).join(', ');
};

export const fetchGroups = async (): Promise<Group[]> => {
  try {
    const response = await fetch(`${runtimeConfig.public.apiBase}/groups`, {
      headers: {
        'Authorization': `${useCookie("token").value}`
      }
    });

    if (!response.ok) {
      throw new Error('Failed to fetch groups');
    }

    const data: Group[] = await response.json();

    return data;
  } catch (error) {
    console.error('Error fetching groups:', error);
    throw error;
  }
};

export const fetchGroupsWithUsers = async (): Promise<Group[]> => {
  try {
    const response = await fetch(`${runtimeConfig.public.apiBase}/groups/allUsers`, {
      headers: {
        'Authorization': `${useCookie("token").value}`
      }
    });

    if (!response.ok) {
      throw new Error('Failed to fetch groups with users');
    }

    const data: Group[] = await response.json();

    return data;
  } catch (error) {
    console.error('Error fetching groups with users:', error);
    throw error;
  }
};

export const createGroup = async (groupData: Group): Promise<Group> => {
  try {
    const response = await fetch(`${runtimeConfig.public.apiBase}/groups`, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        Authorization: `${useCookie("token").value}`
      },
      body: JSON.stringify(groupData)
    });

    if (!response.ok) {
      throw new Error('Failed to create group');
    }

    const data: Group = await response.json();
    data.create_at = formatDate(data.create_at);
    data.updated_at = formatDate(data.updated_at);

    return data;
